import './App.css';
import MainProfile from "./MainProfile"


function profilefunction(detail) {
  return (
    <Profilepic
      id={detail.id}
      key={detail.id}
      name={detail.username}
      email={detail.email}
      img={detail.image}
    />
  );

}

function App() {
  return (
   <MainProfile/>
  );
}

export default App;
